import React from "react";

class Form extends React.Component {
    render(){
        return (
            <div className='form-content-right'>
            <form className="form">
                <h1>
                   Get started with us today! Create your
                   account by filling out the information below.
                </h1>
            </form>
            </div>
        );
    }
}

export default Form;
